import React, { useState } from "react";
import { Link, useHistory } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHome, faPlus, faUser } from "@fortawesome/free-solid-svg-icons";
import axios from "axios";

const Navbar = ({ isAuthenticated, handleLogout, setProducts }) => {
  const [searchTerm, setSearchTerm] = useState("");
  const history = useHistory();

  const handleSearch = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.get(
        `http://localhost:5000/api/products/search?query=${searchTerm}`
      );
      setProducts(response.data);
      history.push("/"); // Redirect to home page after search
    } catch (error) {
      console.error("Error fetching products", error);
    }
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <Link className="navbar-brand" to="/">
        Truequecito
      </Link>
      <button
        className="navbar-toggler"
        type="button"
        data-toggle="collapse"
        data-target="#navbarNav"
        aria-controls="navbarNav"
        aria-expanded="false"
        aria-label="Toggle navigation"
      >
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNav">
        <ul className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link className="nav-link" to="/">
              <FontAwesomeIcon icon={faHome} /> Inicio
            </Link>
          </li>
          {isAuthenticated && (
            <li className="nav-item">
              <Link className="nav-link" to="/publish">
                <FontAwesomeIcon icon={faPlus} /> Publicar Producto
              </Link>
            </li>
          )}
        </ul>
        <form className="form-inline my-2 my-lg-0" onSubmit={handleSearch}>
          <input
            className="form-control mr-sm-2"
            type="search"
            placeholder="Buscar productos..."
            aria-label="Search"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <button className="btn btn-outline-primary my-2 my-sm-0" type="submit">
            Buscar
          </button>
        </form>
        <ul className="navbar-nav ml-auto">
          <li className="nav-item dropdown">
            <a
              className="nav-link dropdown-toggle"
              href="#"
              id="navbarDropdown"
              role="button"
              data-toggle="dropdown"
              aria-haspopup="true"
              aria-expanded="false"
            >
              <FontAwesomeIcon icon={faUser} />
            </a>
            <div className="dropdown-menu" aria-labelledby="navbarDropdown">
              {isAuthenticated ? (
                <>
                  <Link className="dropdown-item" to="/profile">
                    Perfil
                  </Link>
                  <div className="dropdown-divider"></div>
                  <a className="dropdown-item" href="#" onClick={handleLogout}>
                    Cerrar Sesión
                  </a>
                </>
              ) : (
                <>
                  <Link className="dropdown-item" to="/login">
                    Iniciar Sesión
                  </Link>
                  <Link className="dropdown-item" to="/register">
                    Registrarse
                  </Link>
                </>
              )}
            </div>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
